                    botAliasId: "80OHYBZJBJ",
                    localeId: "en_ZA",
                    sessionId: SESSION,
                    inputText: "Hi"
                };
                try {
                    const data = await client.deleteSession(params);
                    console.log("Response:");
                    console.log(data);
                }
                catch (error) {
                    console.log(error);
                }
            }
            catch (err) {
                console.log("Error", err);
            }
        };
    }
    input() {
        console.log("Clicked");
        this.recognize_celebrity();
    }
